import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class="f-z">
      <div class="headerContainer">
        <button type="button" class="q-z" aria-label="Open Navigation"> ::after </button>
        <a class="hfImagesComponent"> <img src="logo.svg" alt="Welcome to React test!" height="50"></img></a>
        <span class="C-z">
          <button class="z-z" type="button" aria-label="show search"></button>
          <a aria-label="Go to my cart. Cart empty." class="n-z">
            ::before
            "My Cart"
            ::after
          </a>
        </span>
      </div>
    </div>
  );
}

export default App;
